import { useState } from "react"

function Login(){
    const [textBtn,setTextBtn] = useState("Nuevo usuario?")
    return(
        <div>
            <div>
                <button 
                    className="btn btn-info btn-lg"
                    onClick={ev=>{
                        ev.preventDefault();
                        if(textBtn === "Nuevo usuario?"){
                            setTextBtn("Usuario antiguo?")
                        }else{
                            setTextBtn("Nuevo usuario?")
                        }
                    }}
                >
                    {textBtn}
                </button>
            </div>
        </div>
    )
}

export default Login
